var loopPatterns = [patterns.stronghold.gem];
while (true) {
	var result = macroService.findPattern(loopPatterns);
	if (result.IsSuccess) {
		log('[*****YeetMacro*****] Loop: ' + result.Path);
		switch(result.Path) {
			case 'stronghold.gem':
				log('[*****YeetMacro*****] Poll Start');
				macroService.pollPattern(patterns.tabs.facilities, { predicatePattern: patterns.facilities.itemWorld, doClick: true });
				log('[*****YeetMacro*****] Poll End');
				sleep(1000);
				log('[*****YeetMacro*****] Poll Start');
				macroService.pollPattern(patterns.facilities.itemWorld, { predicatePattern: patterns.titles.itemWorld, doClick: true });
				log('[*****YeetMacro*****] Poll End');
			break;
		}
	}
    sleep(1000);
}
